window.bookSummaryJSON = "<p><b>The academy is destroyed, the majority of its students massacred by the demons.</b></p> <p>Aria and her Elites struggle with the loss of one of their own while protecting the survivors in their retreat to the Pack.</p> <p>But is the Pack somewhere that Aria can be safe?</p> <p>As Aria discovers more about her identity and her growing magic, it becomes apparent that this is only the first step in her journey. In a race against time, Aria and her mates must find a way to stand against the rising demon threat before they can invade the realm.</p> <p><i>This is a reverse harem book involving MMFM relationships. Intended for mature listeners.</i></p>"; 
